import PageList from "./PageList";
function Pagination(props) {
  const { page, setPage, todoList, filteredTodoList } = props;

  return (
    <div className="mt-2 d-flex align-items-baseline justify-content-between">
      <small className="text-muted">
        Showing {page.currentPage * 10 - 9} to{" "}
        {page.currentPage * 10 <= filteredTodoList.length ? page.currentPage : filteredTodoList.length} of{" "}
        {todoList.length} entries
      </small>

      <PageList page={page} setPage={setPage}></PageList>
    </div>
  );
}
export default Pagination;
